import React from 'react';

// Tämä komponentti näyttää takuutekstin
const WarrantyText = () => (
    <p>
        Yarbo lupaa korjata Yarbo-tuotteet, jotka ovat viallisia virheellisten materiaalien tai työn vuoksi takuuaikana (alkaen toimituspäivästä). Yarbo voi valita korjata tai vaihtaa tuotteet, jotka todetaan viallisiksi. Nämä rajoitetut takuukäytännöt koskevat vain Yarbo-tuotteita, jotka olet ostanut Yarbon valtuutetuilta jälleenmyyjiltä ja Yarbon virallisilta kanavilta kotikäyttöön.
    </p>
);

export default WarrantyText;
